import React, { Component } from 'react'

import Filmlist from "./Filmlist";
import Filmdetails from "./Filmdetails";
import TMDB from "./TMDB";
import './App.css';
export default class App extends Component {
  render() {
    return (

      <div className="film-library">
        {this.props.TMDB}

        <Filmlist />
        <Filmdetails/>
      </div>
    )
  }
}
